let popupButton = null;
let lastSelectedText = '';
let lastRect = null;

// Base64-encoded image (replace with your actual icon if needed)
const iconBase64 = "data:image/png;base64,";

// Listen for selection changes and mouseup events to trigger the button display
document.addEventListener('selectionchange', handleSelection);
document.addEventListener('mouseup', handleSelection);
window.addEventListener('scroll', updatePopupPosition, true); // Capture scroll events from all elements

function handleSelection() {
    setTimeout(() => { // Small delay to allow selection to register properly
        const selectedText = window.getSelection().toString().trim();
        
        if (selectedText && selectedText.length === 1 && selectedText !== lastSelectedText) {
            lastSelectedText = selectedText;
            showPopupButton();
        } else if (!selectedText) {
            hidePopupButton();
        }
    }, 50);
}

function showPopupButton() {
    const selection = window.getSelection();
    if (selection.rangeCount === 0) return;

    const range = selection.getRangeAt(0);
    const rect = range.getBoundingClientRect();
    const scrollX = window.scrollX || document.documentElement.scrollLeft;
    const scrollY = window.scrollY || document.documentElement.scrollTop;

    lastRect = {
        top: rect.top + scrollY,
        left: rect.left + scrollX,
        bottom: rect.bottom + scrollY,
        right: rect.right + scrollX,
    };

    if (!popupButton) {
        popupButton = document.createElement('img');
        popupButton.src = iconBase64;
        popupButton.style.position = 'absolute';
        popupButton.style.zIndex = '1000';
        popupButton.style.width = '24px';
        popupButton.style.height = '24px';
        popupButton.style.cursor = 'pointer';
        popupButton.style.borderRadius = '4px';
        popupButton.style.boxShadow = '0px 0px 5px rgba(0,0,0,0.2)';
        popupButton.style.backgroundColor = 'white';

        document.body.appendChild(popupButton);

        popupButton.addEventListener('click', () => {
            const searchUrl = `https://www.wugniu.com/search?char=${encodeURIComponent(lastSelectedText)}&table=shanghai`;
            window.open(searchUrl, '_blank');
        });
    }

    updatePopupPosition();
    popupButton.style.display = 'block';
}

function updatePopupPosition() {
    if (popupButton && lastRect) {
        popupButton.style.top = `${lastRect.bottom + 5}px`;
        popupButton.style.left = `${lastRect.left}px`;
    }
}

function hidePopupButton() {
    if (popupButton) {
        popupButton.style.display = 'none';
        lastSelectedText = ''; // Reset to allow re-selection of the same character
        lastRect = null;
    }
}

// Hide the button if clicking elsewhere
document.addEventListener('click', (event) => {
    if (popupButton && event.target !== popupButton) {
        hidePopupButton();
    }
});


let wugniuData = {};

fetch(chrome.runtime.getURL('wugniu-dataset.json'))
    .then(response => response.json())
    .then(data => {
        wugniuData = data;
        console.log(' wugniu dataset loaded successfully!');
        processPage();
    })
    .catch(error => console.error(' Failed to load wugniu dataset:', error));

function processPage() {
    console.log("Processing entire page...");
    addwugniuToTextNodes(document.body);
}

function addwugniuToTextNodes(node) {
    if (node.nodeType === Node.TEXT_NODE && 
        !["INPUT", "BUTTON", "TEXTAREA", "SCRIPT", "STYLE", "NOSCRIPT", "IFRAME", "CODE", "PRE"].includes(node.parentElement?.tagName)) {

        let text = node.nodeValue;
        let chineseRegex = /[\u4e00-\u9fff]+/g;
        let generalRegex = /[\p{L}\p{N}.,!?;:"'(){}\[\]<>\/\\@#$%^&*~_\-+=|]/gu;

        let newHTML = '';
        let lastIndex = 0;

        text.replace(chineseRegex, (match, index) => {
            newHTML += processNonChineseText(text.slice(lastIndex, index), generalRegex);
            lastIndex = index + match.length;

            let processedText = processChineseText(match);
            newHTML += processedText;
        });

        newHTML += processNonChineseText(text.slice(lastIndex), generalRegex);

        if (newHTML !== text) {
            let wrapper = document.createElement("span");
            wrapper.innerHTML = newHTML;
            node.replaceWith(wrapper);
        }
    } else if (node.nodeType === Node.ELEMENT_NODE) {
        if (!["SCRIPT", "STYLE", "NOSCRIPT", "IFRAME", "CODE", "PRE"].includes(node.tagName)) {
            for (let child of Array.from(node.childNodes)) {
                addwugniuToTextNodes(child);
            }
        }
    }
}

function processNonChineseText(text, generalRegex) {
    let result = '';
    let lastIndex = 0;

    text.replace(generalRegex, (match, index) => {
        result += text.slice(lastIndex, index);
        lastIndex = index + match.length;
        result += `<ruby>${match}<rt>-</rt></ruby>`;
    });

    result += text.slice(lastIndex);
    return result;
}

function processChineseText(text) {
    let result = '';
    let i = 0;

    while (i < text.length) {
        let foundMatch = false;
        let longestMatch = '';
        let longestwugniu = '';

        for (let j = text.length; j > i; j--) {
            let substring = text.slice(i, j);

            if (wugniuData[substring]) {
                if (substring.length > longestMatch.length) {
                    longestMatch = substring;
                    longestwugniu = wugniuData[substring];
                    foundMatch = true;
                }
            }
        }

        if (foundMatch) {
            let wugniuParts = longestwugniu.split(" ");
            for (let k = 0; k < longestMatch.length; k++) {
                let character = longestMatch[k];
                let wugniu = wugniuParts[k] || '-';
                result += `<ruby>${character}<rt>${wugniu}</rt></ruby>`;
            }

            i += longestMatch.length;
        } else {
            result += `<ruby>${text[i]}<rt>-</rt></ruby>`;
            i++;
        }
    }

    return result;
}
